import logo from "../../images/logo-symbol-blanc.svg";
import React from "react";

export function Title(){
    return <div className='symbol-dispose'>
        <img src={logo} className="App-logo" alt="logo" />
        <h2>
            Test technique 2 : Hochart Guillaume
        </h2>
    </div>
}
